import React, {useState} from 'react';
import { blogData } from './BlogsData';


const Blog = () => {

  const [blogs, setblogs] = useState(blogData);
  return (
    <div className='container'>
      <h1 className='text-center'>Blog Page</h1>
      <section>
        {blogs.map((blogs) => {

          const {id, title, body} = blogs
          
          return (
            <article key={id}>
              <h3> {title} </h3>
              <p> {body} </p>
            </article>
          )
        })}
      </section>
    </div>
  );
}

export default Blog;
